import React from 'react';
import './App.css';

import YouTubeVideoListHolder from '../YouTubeVideoListHolder/YouTubeVideoListHolder';
import Header from '../Header/Header';

class App extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      howard_billy_clip:[],
      howard_clip:[],
      cousin_clip:[],
      full_clip:[],
      lkc_clip:[],
      wedding_clip:[]
    };
  }
  //[howard_billy_clip, howard_clip, full_clip,
  //lkc_clip, cousin_clip, wedding_clip]

  callAPI(videoCategory, videoArray) {
    fetch("http://localhost:9000/videos/" + videoCategory)
      .then(res => res.json())
      .then(res => this.setState({videos: res}))
      .catch(err => err);
  }

  componentWillMount() {
    this.callAPI('howard_billy_clip');
  }

  render() {
    return (
      <div className="App">
        <Header />
        <YouTubeVideoListHolder videoList={this.state.videos}/>
      </div>
    );
  }
}

export default App;
